import { Image, Subtitle, Holder, Title, Container, Inner } from "./styles/jumbotron"

// Original Component
export default function Jumbotron({
  children,
  direction = "row",
  ...restProps
}) {
  console.log(children)

  return <Inner direction={direction}>dickhead</Inner>
}

// Compound Component
Jumbotron.Container = function JumbotronContainer({ children, ...restProps }) {
  return <Container {...restProps}>{children}</Container>
}

Jumbotron.Holder = function JumbotronHolder(children, ...restProps) {
  console.log(children)

  return <Holder {...restProps}>{children}</Holder>
}

Jumbotron.Title = function JumbotronTitle({children, ...restProps}) {
  return <Title {...restProps} >{children}</Title>
}

Jumbotron.Subtitle = function JumbotronSubtitle({children, ...restProps}) {
  return <Subtitle {...restProps} >{children}</Subtitle>
}

Jumbotron.Image = function JumbotronImage({src,alt}) {
  return <Image src={src} alt={alt} />
}
